# LumApps Data lake


This site contains the technical documentation about LumApps Data Lake.
Only LumApps customers with the Enterprise package are offered a read access to this database.

With direct access to the Data lake, LumApps customers can build custom dashboards
using their favorite BI Tools.

Native LumApps dashboards are also built using the Data lake. This means:
- Customers  have the same level of information as LumApps.
- Customers have direct access to new aggregates LumApps builds within the Data lake.

## How to navigate this documentation

On the left drawer, expand the `lumapps-datalake` folder to list the available tables.
For each table, a specific documentation is available where you will find a description of each field available.

### Table Types

There are two types of tables within the Data lake : fact tables and dimension tables.

#### Fact Tables

[Fact Tables](https://en.wikipedia.org/wiki/Fact_table) contain facts about events
that occurred on the platform. In the LumApps context, they contain data
about the interactions between users and various entities. 

Their name is prefixed by `fct_` 

_Example: Interactions of a given user, with a given content on a given day_

#### Dimension Tables

[Dimension Tables](https://en.wikipedia.org/wiki/Dimension_%28data_warehouse%29%23Dimension_table) describe the attributes of
LumApps entities.

Their name is prefixed by `dim_`

_Example: A description of the attributes of a content_

## Connecting to the Data lake

The connection to the Data lake is done via a Google Cloud Platform (GCP) service account. To connect
you need to :
- Create your [GCP service account](https://cloud.google.com/iam/docs/creating-managing-service-accounts#creating)
You do not need to give the service account any permissions, LumApps will do it on the Data lake.
- Provide your LumApps representative with the email address of your service account.
- Your LumApps Representative will inform you when your service account has the required permissions to access the Data lake.
- Use the service account in your favorite BI tool to set up a connection with the Data lake (BigQuery).

To set up the connection between the BI tool and the Data lake, you need the following information:
- A service account key.
- The billing Project : `lumapps-datalake-external`.
It is the project on which the compute power is billed by google.
- The project hosting the data : It will be communicated to you by your LumApps representative.
It corresponds to your production environment where your data is located. It usually looks like `hm-prod-XX-cell-XXX`
- The dataset hosting the data : `external`.

The process of connecting to Google BigQuery is different for every BI tool. The connection is tedious to set up for
some of them. We will try to improve the documentation as our knowledge increases. 

### Connection using Metabase

The connection with Metabase is fairly straightforward.

1. Edit your service-account json-keyfile and change it's `project-id` to `lumapps-datalake`
2. In metabase, set up a new connection
   - type : `Big Query`
   - Name : it is up to you, it will impact how the database is displayed in metabase
   - project Id : The project where the data is located (it looks like `hm-prod-XX-cell-XXX`)
   - Service Account Json File : The keyfile you edited in step 1
   - dataset id : `external`
3. Save change and you are good to go

### Connection using Looker

The connection with Looker is fairly straightforward.

1. In Looker, set up a new connection
   - Name : it is up to you, it will impact how the database is displayed in Looker
   - Dialect : `Google Bigquery Standard SQL`
   - project Id : `lumapps-datalake-external`
   - dataset : `external`
   - Use OAuth : False, you'll be using a service account
   - Service Account Email : The email of your service account
   - Service Account JSON/P12 file: Insert your service account keyfile
2. Create your looker model using LookML
    - While doing so, always target the project where the data is located (it looks like `hm-prod-XX-cell-XXX`)
   using the statement `sql_table_name: 'PROJECT-ID.external.TABLE NAME'`

### Connection using Qlik Sense

Note : Customers are still experiencing trouble connecting with Qlik. We will update this documentation when ready
It seems, Qlik is having trouble handling a billing project different from the data project.

Follow the [documentation](https://help.qlik.com/en-US/connectors/Subsystems/ODBC_connector_help/Content/Connectors_ODBC/GoogleBigQuery/Create-GBQ-Connection.htm)
for **Service Authentication**


### Connection using Google Data Studio

DataStudio does not support natively the connection to google BigQuery via Service Account. 

Google gives an [example](https://developers.google.com/datastudio/solution/blocks/using-service-accounts) of how it could be done.

Following this example : 
The code for the connector we tested at LumApps is below.
For this to work please note you have to : 
- Enter the Json Keyfile of your service account as a json string in the script properties of your custom connector
with the value `SERVICE_ACCOUNT_CREDS`
- In the BASE_SQL, change `YOUR-PROD-PROJECT` by the GCP project where your data is located

**In `code.gs`:**
```javascript
var cc = DataStudioApp.createCommunityConnector();
var scriptProperties = PropertiesService.getScriptProperties();

function isAdminUser() {
  return true;
}

function getAuthType() {
  var AuthTypes = cc.AuthType;
  return cc
    .newAuthTypeResponse()
    .setAuthType(AuthTypes.NONE)
    .build();
}

function getConfig(request) {
  var config = cc.getConfig();

  config
    .newInfo()
    .setId('generalInfo')
    .setText('This is an example connector to showcase a connection to the Lumapps Data Lake.');

  return config.build();
}


var SERVICE_ACCOUNT_CREDS = 'SERVICE_ACCOUNT_CREDS';
var SERVICE_ACCOUNT_KEY = 'private_key';
var SERVICE_ACCOUNT_EMAIL = 'client_email';
var BILLING_PROJECT_ID = 'project_id';

/**
 * Copy the entire credentials JSON file from creating a service account in GCP.
 */
function getServiceAccountCreds() {
  return JSON.parse(scriptProperties.getProperty(SERVICE_ACCOUNT_CREDS));
}

function getOauthService() {
  var serviceAccountCreds = getServiceAccountCreds();
  var serviceAccountKey = serviceAccountCreds[SERVICE_ACCOUNT_KEY];
  var serviceAccountEmail = serviceAccountCreds[SERVICE_ACCOUNT_EMAIL];

  return OAuth2.createService('RowLevelSecurity')
    .setAuthorizationBaseUrl('https://accounts.google.com/o/oauth2/auth')
    .setTokenUrl('https://accounts.google.com/o/oauth2/token')
    .setPrivateKey(serviceAccountKey)
    .setIssuer(serviceAccountEmail)
    .setPropertyStore(scriptProperties)
    .setCache(CacheService.getScriptCache())
    .setScope(['https://www.googleapis.com/auth/bigquery.readonly']);
}

var BASE_SQL =
  'SELECT c.id as ContentId, c.created_at, c.published_at, c.site.status as site_status, c.site.slug as site_slug, c.status as content_status,\
   da.date as PerformedOn, da.nb_content_comments, da.nb_content_likes, da.nb_content_views, da.user_id, \
  (SELECT value from unnest(c.title) where code="en") as content_title ,\
  (SELECT value from unnest(c.slug) where code="en") as content_slug,\
  (SELECT value from unnest(c.site.title) where code="en") as site_title,\
  (SELECT value from unnest(c.custom_content_type.name) where code="en") as content_type_name,\
  FROM `YOUR-PROD-PROJECT.external.dim_contents__ext` c \
  INNER JOIN `YOUR-PROD-PROJECT.external.fct_daily_user_content_activity__ext` da ON c.id=da.content_id';

function getQueryConfig(request) {
  var accessToken = getOauthService().getAccessToken();
  var serviceAccountCreds = getServiceAccountCreds();
  var billingProjectId = serviceAccountCreds[BILLING_PROJECT_ID];

  var bqTypes = DataStudioApp.createCommunityConnector().BigQueryParameterType;

  return cc
    .newBigQueryConfig()
    .setAccessToken(accessToken)
    .setBillingProjectId(billingProjectId)
    .setUseStandardSql(true)
    .setQuery(BASE_SQL)
    .build();
}

function getSchema(request) {
  return getQueryConfig(request);
}

function getData(request) {
  return getQueryConfig(request);
}
```

